import React, {useEffect, useState} from 'react';
import './App.css';
import Home from './components/Home';
import NavBar from './components/Navbar'; 
import AboutUs from './components/Aboutus';
import Confirm from './components/Confirm'; 
import Login from './components/Login';
import Signup from './components/Signup';
import NorthIndian from './components/NorthIndian';
import SouthIndian from './components/SouthIndian';
import Continental from './components/Continental';
import Recipe from './components/Recipe';
import RecipeDetails from './components/RecipeDetails';
import { checkSession } from './sessionService';

import { createBrowserRouter, RouterProvider } from 'react-router-dom';

const router = createBrowserRouter([
  {
    path: '/',
    element: (
      <>
        <NavBar />
        <Home />
      </>
    ),
  },
  {
    path: '/about',
    element: (
      <>
        <NavBar />
        <AboutUs />
      </>
    ),
  },
  {
    path: '/recipes/:id',
    element: (
      <>
        <NavBar />
        <Confirm />
      </>
    ),
  },
  {
    path: '/recipes/:category/:id',
    element: (
      <>
        <NavBar />
        <RecipeDetails />
      </>
    ),
  },
  {
    path: '/login',
    element: (
      <>
        <NavBar />
        <Login />
      </>
    ),
  },
  {
    path: '/signup',
    element: (
      <>
        <NavBar />
        <Signup />
      </>
    ),
  },
  {
    path: '/north',
    element: (
      <>
        <NavBar />
        <NorthIndian />
      </>
    ),
  },
  {
    path: '/south',
    element: (
      <>
        <NavBar />
        <SouthIndian />
      </>
    ),
  },
  {
    path: '/Continental',
    element: (
      <>
        <NavBar />
        <Continental />
      </>
    ),
  },
  {
    path: '/Recipe',
    element: (
      <>
        <NavBar />
        <Recipe />
      </>
    ),
  },
  // {
  //   path: '/recipeinfo/:id', // New route for RecipeInfo
  //   element: (
  //     <>
  //       <NavBar />
  //       <RecipeInfo />
  //     </>
  //   ),
  // },
]);

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const verifySession = async () => {
      const sessionData = await checkSession();
      setIsAuthenticated(sessionData.isAuthenticated);
      setLoading(false);
    };

    verifySession();
  }, []);

  if (loading) return <div>Loading...</div>;

  return (
    <RouterProvider router={router} />
  );
}

export default App;
